description:
This is a custom made hoody dress. Since I hand make each one I can give you options of colors for the main part of the dress, weather you want ears on the hoody or not  and what kind of hoody and pocket lining you d like such as animals, princess, hearts, starts and so much more, Just need to ask. Imagine your sports teams colors

Please see my sister shop www.christiencollection.etsy.com         and like me on Facebook www.facebook.com/christiencollection                                              for new items sales and games

