New and can be custom made in many sizes and styles, This one shown is a classic grey and My little pony hoody, The inside is nice and soft and not scratchy for your little ones, Since I hand make each one you can choose colors and patterns for your little one princess star wars planes trains kittens stars ect. This is made from a fleece fabric and lined with a sturdy cotton or flannel fabric.

 ♥ We recommend when washing to turn them inside out to preserve color. Tumble dry on low or lay flat to dry♥

